import React, { Component } from 'react';
import { Header } from './components/Header';
import { MainNavigation } from './Navigation/MainNavigation';
import { Home } from './components/Home';
import { Investment } from './components/Investment/Investment';
import { InvestmentDetail } from './components/Investment/InvestmentDetail';
import { Services } from './components/Services';
import { Contact } from './components/Contact';
import { Blog } from './components/Blog';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { fab } from '@fortawesome/free-brands-svg-icons';
import { faLongArrowAltLeft } from '@fortawesome/free-solid-svg-icons';
import { callExpression } from '@babel/types';

class App extends Component {
    constructor(props) {
        super(props);
        this.state = {
            mainContent: null
        }
    } 

    handleNav(value) {
        value = 'blog';
        if (value === 'home') {
            this.setState({mainContent: <Home/>});
        }else if (value === 'investment') {
            this.setState({mainContent: <Investment/>});
        }else if (value === 'services') {
            this.setState({mainContent: <Services/>});
        }else if (value === 'contact') {
            this.setState({mainContent: <Contact/>});
        }else if (value === 'blog') {
            this.setState({mainContent: <Blog/>});
        }
    }

    render() {
        return (
            <div>
                <div className="loader2">
                    <div className="loader loader_each"><span></span></div>
                </div>
                <div id="main">
                    <Header />
                    <div id="wrapper">
                        <div className="content-holder" data-pagetitle="Home Half Slider">

                            <MainNavigation navValue={(value) => { this.handleNav(value) }} />
                            {/* <Home /> */}
                            {this.state.mainContent}

                            <div className="share-wrapper">
                                <div className="close-share-btn"><FontAwesomeIcon icon={faLongArrowAltLeft} /> Close</div>
                                <div className="share-container fl-wrap  isShare"></div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        );
    }
}

export default App;
